pub trait Requestor {
	type Error: StdError + 'static;
	fn request(&self, url: &str, cookie: &str) -> Result<String, Self::Error>;
}

pub trait Cache {
	type Error: StdError + 'static;
	fn get(&self, k: u32) -> Result<Option<&[u8]>, Error>;
	fn set(&self, k: u32, v: &[u8]) -> Result<(), Error>;
}

#[derive(Debug)]
pub enum Request {
	Movie(String),
	Series(String),
	Episode(String),
}

#[derive(Debug)]
pub struct Operator<R, C> {
	req: R,
	cache: C,
	cookie: String,
	max_pages: u32,
	max_torrents: u32,
	req_interval: Duration,
}

#[derive(Debug)]
pub struct Torrent {
	label_id: u32,
	age: String,
	uploader: Option<String>,
	free_leech: bool,
	title: String,
	id: u32,
	torrent_title: String,
	comment_count: u32,
	size: u64,
	file_count: u32,
	snatches: u32,
	seeders: u32,
	leechers: u32,
}

#[derive(Debug, Serialize, Deserialize)]
pub struct TorrentFile {
	title: String,
	size: u64,
}

struct Response {
	inner: Html,
}

